import React from "react";

export default function TaskBar({count, status}) {
  return (
    <div
      className="task__title"
      style={{
        fontSize: "2rem",
        textTransform: "capitalize",
        padding: "2rem",
      }}
    >
      {getStatus(status)} - {count}
    </div>
  );
}
